import Header from "../Components/Home/Header"

const HomePage = () => {

    useEffect(() => {
        const getRequest = async() => {
         const response = await  fetch("https://localhost:8080/");
         console.log(await response.json());

        }
        getRequest();

    },[]);

    return <Fragment> <Header/> </Fragment>

}

export default HomePage;
